    /*** Tests and Suites ***/

    typedef enum
    {
        /* Test successful */
        MUNIT_OK,
        /* Test failed */
        MUNIT_FAIL,
        /* Test was skipped */
        MUNIT_SKIP,
        /* Test failed due to circumstances not intended to be tested
         * (things like network errors, invalid parameter value, failure to
         * allocate memory in the test harness, etc.). */
        MUNIT_ERROR
    } MunitResult;

    typedef struct
    {
        char *name;
        char **values;
    } MunitParameterEnum;

    typedef struct
    {
        char *name;
        char *value;
    } MunitParameter;

