const char *
munit_parameters_get(const MunitParameter params[], const char *key)
{
    const MunitParameter *param;

    for (param = params; param != NULL && param->name != NULL; param++)
        if (strcmp(param->name, key) == 0)
            return param->value;
    return NULL;
}

