static void
munit_print_time(FILE *fp, munit_uint64_t nanoseconds)
{
    fprintf(fp, "%" MUNIT_TEST_TIME_FORMAT, ((double)nanoseconds) / ((double)PSNIP_CLOCK_NSEC_PER_SEC));
}
