int fail_malloc_at = -1;
int malloc_call_counter = 0;
extern void* __real_malloc(size_t);
void* __wrap_malloc(size_t size) {
    if(fail_malloc_at >= 0 && malloc_call_counter == fail_malloc_at)
    {
        errno = -ENOMEM;
        return NULL;
    }
    malloc_call_counter++;
    return __real_malloc(size);
}

